-- ----------------------------
-- View structure for viewallstudents
-- ----------------------------
DROP VIEW IF EXISTS `viewallstudents`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `viewallstudents` AS -- SELECT 'FIRSTNAME','MIDDLENAME','LASTNAME','GENDER','ADDRESS','BIRTHDATE','SCHOOL','STATUS','GRADUATE','ASSESSED','SCHOLAR' FROM students UNION
SELECT T1.firstname '0',T1.middlename '1',T1.lastname '2',T1.gender '3',T1.address '4',T1.birthdate '5',T2.school '6',CASE WHEN T1.`status`=1 THEN 'ENROLLED' WHEN T1.`status`=0 THEN 'NOT ENROLLED' ELSE 'DROPPED OUT' END '7',
CASE WHEN t1.is_graduate=1 THEN 'YES' ELSE 'NO' END '8', CASE WHEN T1.is_assessed=1 THEN 'YES' ELSE 'NO' END '9', CASE WHEN T1.is_scholar=1 THEN 'YES' ELSE 'NO' END '10'
FROM students T1 
LEFT JOIN schools T2 ON T2.school_id=T1.school_id ;

-- ----------------------------
-- View structure for viewncpershool
-- ----------------------------
DROP VIEW IF EXISTS `viewncpershool`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `viewncpershool` AS SELECT T3.school,T4.qualification_program_title,T1.date_from,DATE_FORMAT(T1.date_from,'%Y') yearD,T2.school_id ,T1.qualification_program_title_id qpt_id FROM certificates T1
LEFT JOIN students T2 ON T1.student_id=T2.student_id
LEFT JOIN schools T3 ON T2.school_id=T3.school_id
LEFT JOIN qualification_program_titles T4 ON T1.qualification_program_title_id=T4.qualification_program_title_id
WHERE T2.`status`=1 AND T2.soft_deleted=0 ;

-- ----------------------------
-- View structure for viewncpershoolstatus
-- ----------------------------
DROP VIEW IF EXISTS `viewncpershoolstatus`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `viewncpershoolstatus` AS SELECT T3.school,T4.qualification_program_title,T1.date_from,DATE_FORMAT(T1.date_from,'%Y') yearD, CASE WHEN T2.`status`=1 THEN 'ENROLLED' WHEN T2.`status`=0 THEN 'NOT ENROLLED' ELSE 'DROPPED OUT' END state,CASE WHEN T2.`status`=1 THEN '#31d253' WHEN T2.`status`=0 THEN '#888888' ELSE '#ff3333' END color FROM certificates T1
LEFT JOIN students T2 ON T1.student_id=T2.student_id
LEFT JOIN schools T3 ON T2.school_id=T3.school_id
LEFT JOIN qualification_program_titles T4 ON T1.qualification_program_title_id=T4.qualification_program_title_id
WHERE T2.soft_deleted=0 ;

-- ----------------------------
-- View structure for viewncpershoolyear
-- ----------------------------
DROP VIEW IF EXISTS `viewncpershoolyear`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `viewncpershoolyear` AS SELECT T3.school,T4.qualification_program_title,T1.date_from,DATE_FORMAT(T1.date_from,'%Y') yearD,T3.school_id FROM certificates T1
LEFT JOIN students T2 ON T1.student_id=T2.student_id
LEFT JOIN schools T3 ON T2.school_id=T3.school_id
LEFT JOIN qualification_program_titles T4 ON T1.qualification_program_title_id=T4.qualification_program_title_id
WHERE T2.`status`=1 AND T2.soft_deleted=0 ;

-- ----------------------------
-- View structure for viewncpershool_group
-- ----------------------------
DROP VIEW IF EXISTS `viewncpershool_group`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `viewncpershool_group` AS SELECT T1.*, COUNT(T1.school) cc FROM viewncpershool T1
GROUP BY T1.school,T1.qualification_program_title,T1.yearD ;

-- ----------------------------
-- View structure for viewncpershool_groupa
-- ----------------------------
DROP VIEW IF EXISTS `viewncpershool_groupa`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `viewncpershool_groupa` AS SELECT T1.qualification_program_title_id,T1.qualification_program_title,T2.school_id, T2.school,COALESCE(T3.yearD,0) yearD,COALESCE(T3.cc,0) cc FROM qualification_program_titles T1
LEFT JOIN schools T2 ON T2.school_id=T1.school_id
LEFT JOIN viewncpershool_group T3 ON T1.qualification_program_title=T3.qualification_program_title AND T2.school_id=T3.school_id
WHERE T1.soft_deleted=0 ;

-- ----------------------------
-- View structure for viewncpershool_group_dropped
-- ----------------------------
DROP VIEW IF EXISTS `viewncpershool_group_dropped`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `viewncpershool_group_dropped` AS SELECT count(T2.`status`)cc, T3.school,T4.qualification_program_title,T1.date_from,DATE_FORMAT(T1.date_from,'%Y') yearD,T2.school_id ,T1.qualification_program_title_id qpt_id,
CASE WHEN T2.`status`=1 THEN 'E' WHEN T2.`status`=0  THEN 'D' ELSE 'NE' END state 
FROM certificates T1
LEFT JOIN students T2 ON T1.student_id=T2.student_id
LEFT JOIN schools T3 ON T2.school_id=T3.school_id
LEFT JOIN qualification_program_titles T4 ON T1.qualification_program_title_id=T4.qualification_program_title_id
WHERE t2.`status`=0 AND T2.soft_deleted=0 
GROUP BY T3.school,T4.qualification_program_title,DATE_FORMAT(T1.date_from,'%Y') ;

-- ----------------------------
-- View structure for viewncpershool_group_enrolled
-- ----------------------------
DROP VIEW IF EXISTS `viewncpershool_group_enrolled`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `viewncpershool_group_enrolled` AS SELECT count(T2.`status`)cc, T3.school,T4.qualification_program_title,T1.date_from,DATE_FORMAT(T1.date_from,'%Y') yearD,T2.school_id ,T1.qualification_program_title_id qpt_id,
CASE WHEN T2.`status`=1 THEN 'E' WHEN T2.`status`=0  THEN 'D' ELSE 'NE' END state 
FROM certificates T1
LEFT JOIN students T2 ON T1.student_id=T2.student_id
LEFT JOIN schools T3 ON T2.school_id=T3.school_id
LEFT JOIN qualification_program_titles T4 ON T1.qualification_program_title_id=T4.qualification_program_title_id
WHERE t2.`status`=1 AND T2.soft_deleted=0 
GROUP BY T3.school,T4.qualification_program_title,DATE_FORMAT(T1.date_from,'%Y') ;

-- ----------------------------
-- View structure for viewncpershool_group_notenrolled
-- ----------------------------
DROP VIEW IF EXISTS `viewncpershool_group_notenrolled`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `viewncpershool_group_notenrolled` AS SELECT count(T2.`status`)cc, T3.school,T4.qualification_program_title,T1.date_from,DATE_FORMAT(T1.date_from,'%Y') yearD,T2.school_id ,T1.qualification_program_title_id qpt_id,
CASE WHEN T2.`status`=1 THEN 'E' WHEN T2.`status`=0  THEN 'D' ELSE 'NE' END state 
FROM certificates T1
LEFT JOIN students T2 ON T1.student_id=T2.student_id
LEFT JOIN schools T3 ON T2.school_id=T3.school_id
LEFT JOIN qualification_program_titles T4 ON T1.qualification_program_title_id=T4.qualification_program_title_id
WHERE t2.`status`>1 AND T2.soft_deleted=0 
GROUP BY T3.school,T4.qualification_program_title,DATE_FORMAT(T1.date_from,'%Y') ;

-- ----------------------------
-- View structure for viewncpershool_group_percentage
-- ----------------------------
DROP VIEW IF EXISTS `viewncpershool_group_percentage`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `viewncpershool_group_percentage` AS SELECT T1.*, COALESCE(T3.cc,0) `DRP`,COALESCE(T4.cc,0) `NE`,T1.cc+COALESCE(T3.cc,0)+COALESCE(T4.cc,0) totalcc,

CASE WHEN COALESCE((T1.cc / T1.cc+COALESCE(T3.cc,0)+COALESCE(T4.cc,0))*100,0)=100 THEN 100 ELSE COALESCE((T1.cc / T1.cc+COALESCE(T3.cc,0)+COALESCE(T4.cc,0))*10,0) END prct
FROM viewncpershool_groupa T1

LEFT JOIN viewncpershool_group_dropped T3
ON T1.qualification_program_title=T3.qualification_program_title
AND T1.school=T3.school
AND T1.yearD=T3.yearD

LEFT JOIN viewncpershool_group_notenrolled T4
ON T1.qualification_program_title=T4.qualification_program_title
AND T1.school=T4.school
AND T1.yearD=T4.yearD ;

-- ----------------------------
-- View structure for viewscholars
-- ----------------------------
DROP VIEW IF EXISTS `viewscholars`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `viewscholars` AS SELECT T2.school,T1.student_id,DATE_FORMAT(T1.date_created,'%Y') yearD FROM students T1
LEFT JOIN schools T2 ON T1.school_id=T2.school_id
WHERE T1.`status`=1 AND T1.soft_deleted=0
AND T1.is_scholar=1 AND T2.school IS NOT NULL ;

SET FOREIGN_KEY_CHECKS = 1;
